Stargate is a 1994 American military science fiction film released through
Metro~Goldwyn~Mayer [MGM] and Carolco Pictures. Created by Dean Devlin and Roland
Emmerich, the film is the first release in the Stargate franchise. Directed by Roland
Emmerich, the film stars Kurt Russell, James Spader, Jaye Davidson, Carlos Lauchu, Djimon
Honsou, Erick Avari, Alexis Cruz, Mili Avital, John Diehl, French Stewart, and Viveca Lindfors.
The plot centers around the premise of a &quot;Stargate&quot;, an ancient ring-shaped device that
creates a wormhole enabling travel to a similar device a galaxy away. The film's central plot
explores the theory of extraterrestrial beings having an influence upon human civilization.

